  return (
    <div className="my-5">
      <h5><strong>Quick Actions</strong></h5>
      <div id="quick-actions">
        <div><button type="button" className="btn btn-secondary quick-btn">New Customer</button></div>
        <div><button type="button" className="btn btn-secondary quick-btn">New Service Request</button></div>
        <div><button type="button" className="btn btn-secondary quick-btn">Add to Inventory</button></div>
      </div>
    </div>
  )
}

export default QuickActions;
